import React, { useState } from 'react';
import { Link, Route, Switch } from 'react-router-dom';
import UserForm from './UserForm';
import AddInternship from './InternshipForm';
import AddJob from './JobForm';
import Logout from './Logout';

const AdminDashboard = () => {
  // Define a function to handle user form submission
  const handleUserSubmit = (userData) => {
    // Handle user submission here (e.g., make an API request)
    console.log('Submitted User Data:', userData);
  };

  return (
    <div>
      <header className="header">
        <div className="left-navbar">
          <p className="nav-titles">CBIT - ADMIN DASHBOARD</p>
        </div>
        <div>
          <ul>
           <li>
              <Link to="./">Home</Link>
            </li>
            <li>
              <Link to="/admin/add-user">Add User</Link>
            </li>
            <li>
              <Link to="/admin/add-internship">Add Internship</Link>
            </li>
            <li>
              <Link to="/admin/add-job">Add Job</Link>
            </li>
            <li>
              <Link to="/admin/logout">Logout</Link>
            </li>
          </ul>
        </div>
      </header>

      <Switch>
        <Route path="/admin/add-user" component={UserForm} />
        <Route path="/admin/add-internship" component={AddInternship} />
        <Route path="/admin/add-job" component={AddJob} />
        <Route path="/admin/logout" component={Logout} />
      </Switch>
    </div>
  );
};

export default AdminDashboard;
